import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

let myPostsData = [
  {id:1, title: "Пост 1", text: "Текст", likes: 12, dislikes: 3},
  {id:1, title: "Пост 2", text: "Текст", likes: 16, dislikes: 5},
  {id:1, title: "Пост 3", text: "Текст", likes: 21, dislikes: 8},
  {id:1, title: "Пост 4", text: "Текст", likes: 16, dislikes: 2},
]

let dialogsData = [
  {id:1, name: "Pavel"},
  {id:2, name: "Petr"},
  {id:3, name: "Dima"},
  {id:4, name: "Anton"},
]

let messagesData = [
  {id:1, message: "Hello"},
  {id:2, message: "Hi"},
  {id:3, message: "How are you?"},
  {id:4, message: "Bye"},
]

let allPostsData = [
  { id: 1, username: "Pavel", title: "Заголовок 1", text: "Текст", likes: 12, dislikes: 3 },
  { id: 1, username: "Petr", title: "Заголовок 2", text: "Текст", likes: 16, dislikes: 5 },
  { id: 1, username: "Dima", title: "Заголовок 3", text: "Текст", likes: 21, dislikes: 8 },
  { id: 1, username: "Anton", title: "Заголовок 4", text: "Текст", likes: 16, dislikes: 2 },
]

ReactDOM.render(
  <App 
  myPostsData={myPostsData} 
  dialogsData={dialogsData} 
  messagesData={messagesData} 
  allPostsData={allPostsData}/>, document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
